description:
Nemiro.Convertion is small helper class for converting a data types to another data types in .NET Framework.

Features

* Safe conversion the DBNull, NULL and empty values; 
* Processing floating-point numbers, regardless of the type of decimal separator (dot or comma); 
* Number system conversion: hexadecimal, hexatrigesimal, duosexagesimal, etc.; 
* Easy to specify the date format for converting; 
* Using the default values for zero incoming values.

The purpose of the project is to enable attribute routing and minimizing the code changes with switching between Nancy and ASP.NET WebAPI.
Here is some sample usage:

[RoutePrefix("api/userApi")]
public class UserApi : ApiController
{       
    [HttpGet("/")]
    public IEnumerable<User> GetAll()
    {
        return new List<User> { new User(), new User() };
    }


    [HttpGet("/{id}")]
    public User GetById(int id)
    {
        return new User();
    }
}

The Nakov.TurtleGraphics .NET library provides  very simple "turtle graphics" drawing interface for C# / .NET Windows Forms, designed for kids, learning to code.

It supports all standard turtle commands like "move-forward", "move-backward", "rotate", "move-to", "pen-up", "pen-down". Animates the turtle actions to demonstrate how it moves and rotates.

It provides a really simple API:
 - Turtle.Rotate(30);
 - Turtle.Forward(200);
 - Turtle.PenUp();
 - Turtle.Rotate(120);
 - Turtle.Forward(200);
 - Turtle.PenDown();
 - Turtle.Rotate(120);
 - Turtle.Forward(200);

